import React from "react";
import '../ItemLista/style.css'

const ItemLista = (props) => {
return (
    <main>
        <div id="Container">
            <h2>
                {props.signo}
            </h2>

            <p>
                Nascidos entre: {props.dataInicio} - {props.dataFim}
            </p>
        </div>
    </main>
);}

export default ItemLista;
